const querystring = require('querystring');
const url = require('url');

module.exports = class Request {
    /**
     * Creates an instance of `Request`.
     *
     * @param {http.IncomingMessage} incomingMessage
     * @see https://nodejs.org/api/http.html#http_class_http_incomingmessage
     */
    constructor(incomingMessage) {
        this[Symbol.for('url')] = url.parse(incomingMessage.url);

        /** @type {string} */
        this.accept = incomingMessage.headers.accept;

        /** @type {string} */
        this.acceptLanguage = incomingMessage.headers['accept-language'];

        /** @type {string} */
        this.dnt = incomingMessage.headers['dnt'];

        /** @type {Object} */
        this.headers = incomingMessage.headers;

        /** @type {string} */
        this.host = incomingMessage.headers['host'];

        /** @type {string} */
        this.method = incomingMessage.method.toLowerCase();

        /** @type {string} */
        this.path = this[Symbol.for('url')].pathname;

        /**
         * @type {Object<string, string|Array<string>>}
         * @see https://nodejs.org/api/querystring.html#querystring_querystring_parse_str_sep_eq_options
         */
        this.query = querystring.parse(this[Symbol.for('url')].query);

        /** @type {string} */
        this.userAgent = incomingMessage.headers['user-agent'];
    }

    /**
     * @type {Object}
     */
    get uriVariables() {
        return this[Symbol.for('uriVariables')] || {};
    }

    /**
     * @type {Object}
     */
    set uriVariables(uriVariables) {
        this[Symbol.for('uriVariables')] = uriVariables;
    }
};

const env = require('./env');

module.exports = class Response {
    /**
     * Creates an instance of `Response`.
     *
     * @param {http.ServerResponse} serverResponse
     * @see https://nodejs.org/api/http.html#http_class_http_serverresponse
     */
    constructor(serverResponse) {
        this[Symbol.for('body')] = '';
        this[Symbol.for('response')] = serverResponse;
    }

    /**
     * @type {string}
     */
    get body() {
        return this[Symbol.for('body')];
    }

    /**
     * @type {string}
     */
    set body(data) {
        this[Symbol.for('body')] = data;
    }

    /**
     * @type {string}
     */
    get contentType() {
        return this[Symbol.for('response')].getHeader('Content-Type');
    }

    /**
     * @type {string}
     */
    set contentType(type) {
        this[Symbol.for('response')].setHeader('Content-Type', type);
    }

    /**
     * @type {*}
     */
    get json() {
        return JSON.parse(this[Symbol.for('body')]);
    }

    /**
     * @type {*}
     */
    set json(data) {
        this.contentType = `application/json; charset=${env('BQ_DEFAULT_CHARSET')}`;
        this[Symbol.for('body')] = JSON.stringify(data, null, 4);
    }

    /**
     * @type {string}
     */
    get html() {
        return this[Symbol.for('body')];
    }

    /**
     * @type {string}
     */
    set html(data) {
        this.contentType = `text/html; charset=${env('BQ_DEFAULT_CHARSET')}`;
        this[Symbol.for('body')] = data;
    }

    /**
     * Writes the output data and calls `http.ServerResponse#end()`
     *
     * @return {boolean}
     * @see https://nodejs.org/api/http.html#http_response_end_data_encoding_callback
     */
    send() {
        this.write();

        return this[Symbol.for('response')].end();
    }

    /**
     * @type {number}
     */
    get statusCode() {
        return this[Symbol.for('response')].statusCode;
    }

    /**
     * @type {number}
     */
    set statusCode(code) {
        this[Symbol.for('response')].statusCode = code;
    }

    /**
     * @type {string}
     */
    get text() {
        return this[Symbol.for('body')];
    }

    /**
     * @type {string}
     */
    set text(data) {
        this.contentType = `text/plain; charset=${env('BQ_DEFAULT_CHARSET')}`;
        this[Symbol.for('body')] = data;
    }

    /**
     * Calls and returns the result of `http.ServerResponse#write(this.body)`
     * and resets `this.body` back to an empty string.
     *
     * @return {boolean}
     * @see https://nodejs.org/api/http.html#http_response_write_chunk_encoding_callback
     */
    write() {
        // Save a reference to the body before we reset it so we can return it.
        const body = this[Symbol.for('body')];
        this[Symbol.for('body')] = '';

        return this[Symbol.for('response')].write(body);
    }
};

/**
 * If only the `name` parameter is provided this function acts as a getter for
 * `process.env`. However if `name` and `value` are provide it acts as a setter
 * for `process.env`. When acting as a getter the function will try to call
 * `JSON.parse()` on the value cast to lowercase _(to convert `'true'` to `true`,
 * `'TRUE'` to `true`, `'1'` to `1`, etc.)_ and if that fails it will return the
 * value verbatim.
 *
 * @param {string} name - The envvar name to interact with.
 * @param {*} [value] - If provided sets the value of the `name` envvar.
 * @return {*} The parsed envvar value, regardless of if called as a getter or setter.
 * @see https://nodejs.org/api/process.html#process_process_env
 */
module.exports = function env(name, value) {
    if (value !== undefined) {
        process.env[name] = value;
    }

    const _value = process.env[name];

    try {
        return JSON.parse(_value.toLowerCase());
    } catch (_) {
        return _value;
    }
};

const env = require('./env');
const http = require('http');
const Request = require('./Request');
const Response = require('./Response');
const UriTemplate = require('./UriTemplate');
const url = require('url');

const noop = () => {};

module.exports = class Bq {
    constructor() {
        this.routes = {};

        const defaults = {
            BQ_DEFAULT_CHARSET: 'utf-8',
            BQ_RUN_DEFAULT_PORT: 8080,
            BQ_RUN_DISPLAY_MSG: true
        };

        Object.entries(defaults).forEach(pair => {
            const [name, value] = pair;

            if (env(name) === undefined) {
                env(name, value);
            }
        });
    }

    /**
     * A helper method to work with the instance's internal `#routes` property.
     * Acts as a getter if the `route` parameter is not specified and a setter
     * if it is. This method always returns the specified route object.
     *
     * @param {string} path - The path name to get/set the route _(e.g. `'/resource'`)_.
     * @param {Route} [route] - An object consisting of callback functions mapped to method keys.
     * @return {RouteHandler}
     */
    route(path, route) {
        if (route) {
            this.routes[path] = route;
        }

        return Object.keys(this.routes).reduce((accumulator, routeId) => {
            if (!new UriTemplate(routeId).test(path)) {
                return accumulator;
            }

            return this.routes[routeId];
        }, noop);
    }

    /**
     * Start the app server.
     *
     * @param {Object} [settings={port: 8080}] - The port setting defaults to the value of the `BQ_RUN_DEFAULT_PORT` envvar.
     * @return {http.Server} The server instance that has been started.
     * @see https://nodejs.org/api/http.html#http_class_http_server
     */
    run(settings = {}) {
        const defaults = {port: env('BQ_RUN_DEFAULT_PORT')};
        const {port} = Object.assign(defaults, settings);
        const uri = `http://localhost:${port}/`;
        const server = http.createServer(this.serve.bind(this));

        if (env('BQ_RUN_DISPLAY_MSG')) {
            console.log(`Now listening at <${uri}>.`);
        }

        return server.listen(port);
    }

    /**
     * The callback invoked by `#run()` when the server receives a client request.
     *
     * @param {http.IncomingMessage} incomingMessage
     * @param {http.ServerResponse} serverResponse
     * @return {undefined}
     * @see https://nodejs.org/api/http.html#http_class_http_incomingmessage
     * @see https://nodejs.org/api/http.html#http_class_http_serverresponse
     * @see https://nodejs.org/api/http.html#http_response_end_data_encoding_callback
     */
    serve(incomingMessage, serverResponse) {
        let request = new Request(incomingMessage);
        let response = new Response(serverResponse);
        let uriTemplate = Object.keys(this.routes).reduce((accumulator, routeId) => {
            let uriTemplate = new UriTemplate(routeId);

            if (!uriTemplate.test(request.path)) {
                return accumulator;
            }

            return uriTemplate;
        }, new UriTemplate());
        let route = this.route(request.path);
        let method = request.method;
        request.uriVariables = uriTemplate.getVariables(request.path);

        if (!route || !route[method]) {
            Object.assign(response, {statusCode: 404, text: 'Resource not found.'});
            response.send();

            return;
        }

        const callback = route[method];

        /** @see https://stackoverflow.com/questions/38508420/how-to-know-if-a-function-is-async#answer-38510353 */
        if (callback[Symbol.toStringTag] === 'AsyncFunction') {
            callback(request, response).catch(error => {
                Object.assign(response, {statusCode: 500, text: JSON.stringify(error)});
            }).then(() => {
                response.send();
            });
        } else {
            callback(request, response);
            response.send();
        }
    }
};
